--
-- Definition of procedure `sp_fixdiscount`
--

DROP PROCEDURE IF EXISTS `sp_fixdiscount`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`dbb`@`192.168.1.94` PROCEDURE `sp_fixdiscount`()
BEGIN







DROP TABLE IF EXISTS TEMP;

CREATE TEMPORARY TABLE TEMP

(

	id int,

	soidsales varchar(15),

	soidorder varchar(15),

	qty int,

	unitprice double(18,2),

	itemamount double(18,2),

	itemdiscount double(18,2),

	itemdiscountamount float,

	totaldiscount double(18,2),

	remarks varchar(15),

	itemmount double(18,2), 

	totalamount double(18,2),

	fortotaldiscount double(18,2),

	fortotalamount double(18,2)

);

DROP TABLE IF EXISTS TEMP2;

CREATE TEMPORARY TABLE TEMP2

(

	id int,

	soid varchar(15),

	fortotaldiscount double(18,2),

	fortotalamount double(18,2)

);


select a.id, a.soid, b.soid, b.qty, b.unitPrice, (b.qty * b.unitprice), b.discount, 0 , a.totaldiscount, if(b.discount=a.totaldiscount,'true','false'), b.amount, a.total, 0,0

from tblsales b 

left join tblsalesorder a on a.soID=b.soid;





UPDATE TEMP SET itemdiscountamount=ifnull(itemamount*(itemdiscount/100),0);


UPDATE TEMP2 a

SET fortotaldiscount=(select sum(itemdiscountamount) from TEMP b where a.soid = b.soidsales);

 

UPDATE TEMP2 a

SET fortotalamount=(select sum(itemamount)-sum(itemdiscount) from TEMP b where a.soid = b.soidsales);



select * from TEMP;

update tblsalesorder a left join TEMP2 b on a.soid = b.soID and a.id = b.id

set a.totaldiscount = b.fortotaldiscount, a.total=b.fortotalamount;



select a.id, a.soid, b.soid, a.fortotaldiscount, b.totaldiscount, a.fortotalamount, b.total from TEMP2 a 

left join tblsalesorder b on a.soid = b.soID and a.id = b.id;





END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_inventoryreport`
--

DROP PROCEDURE IF EXISTS `sp_inventoryreport`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`dbb`@`192.168.1.94` PROCEDURE `sp_inventoryreport`(IN `paramcode` vARCHAR(50))
BEGIN



DECLARE done INT;

DECLARE done2 INT;

DECLARE codex int;

DECLARE datetransx date;

DECLARE datex date;

DECLARE endingx double(18,2);

DROP TABLE IF EXISTS TEMP;

CREATE TEMPORARY TABLE TEMP (

	transdate Date,

	code INT,

	mnemonic varchar(20),

	beg int,

	qtyin int,

	qtyout int,

	ending int,

	amount double(18,2),

	category varchar(50),

	id varchar(15),

	remarks varchar(100)

);

if paramcode = '' or paramcode='all' then





else





end if;



UPDATE TEMP a left join tblorder b on a.id = b.idorder 

set a.transdate=b.dateReceived, a.id = b.roID where a.mnemonic ='RCV';



UPDATE TEMP a left join tblsalesorder b on a.id = b.soid 

set a.transdate=b.dateSO where a.mnemonic ='SO';



UPDATE TEMP a left join tblpullout b on a.id = b.pulloutID

set a.transdate=b.datePullOut where a.mnemonic ='POut';



UPDATE TEMP a 

left join tblitem b on a.code = b.code

left join tblitemcategory c on b.idCategory = c.idCategory

set a.category = c.Category; 



DROP TABLE IF EXISTS TEMP2;

CREATE TEMPORARY TABLE TEMP2 (



	transdate Date,

	code INT,

	mnemonic varchar(20),

	beg int,

	qtyin int,

	qtyout int,

	ending int,

	amount double(18,2),

	category varchar(50),

	id varchar(15),

	remarks varchar(100)



);


BEGIN

DECLARE cur CURSOR FOR SELECT distinct CODE FROM TEMP2;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;



OPEN cur;

 SET done = 0;

   read_loop: LOOP

	    FETCH cur INTO codex;

	    IF done THEN

	    	LEAVE read_loop;

	    END IF;



		 	BEGIN

			DECLARE cur2 CURSOR FOR SELECT transdate FROM TEMP2 where code = codex order by transdate;

			DECLARE CONTINUE HANDLER FOR NOT FOUND SET done2 = 1;

			

			set endingx = (select ending from TEMP2 WHERE MNEMONIC = 'BEG' and code = codex limit 1);

			

			OPEN cur2;

			 SET done2 = 0;

			   read_loop2: LOOP

				    FETCH cur2 INTO datetransx;

				    IF done2 THEN

				    	LEAVE read_loop2;

				    END IF;

 				    	 set datex = datetransx;

					 	 UPDATE TEMP2 SET beg = endingx

						 WHERE code = codex and transdate = datetransx;

						 

						 UPDATE TEMP2 SET ending = (beg + qtyin - qtyout)

						 WHERE code = codex and transdate = datetransx;

						 

					 	 

         		    set endingx = (select ending FROM TEMP2 WHERE transdate = datex and code = codex limit 1);

			      

				END LOOP;

			CLOSE cur2;

			END;

       

	 	  	 

	END LOOP;

CLOSE cur;

END;





if paramcode = '' or paramcode='all' then

	SELECT * FROM TEMP2;

else

	select * from TEMP2 WHERE CODE = paramcode;

	

end if;







END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_invhistory`
--

DROP PROCEDURE IF EXISTS `sp_invhistory`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`dbb`@`192.168.1.94` PROCEDURE `sp_invhistory`(IN `paramcode` vARCHAR(50))
BODY: BEGIN



DECLARE done INT;

DECLARE done2 INT;

DECLARE codex int;

DECLARE datetransx date;

DECLARE datex date;

DECLARE endingx double(18,2);

DECLARE idex int;

DECLARE minx int;

DROP TABLE IF EXISTS TEMP;

CREATE TEMPORARY TABLE TEMP (

	id int NOT NULL AUTO_INCREMENT,

	transdate Date,

	transid int,

	transNo varchar(20),

	transdesc varchar(20),

	code INT,

	qtybeg int,

	qtyin int,

	qtyout int,

	qtyend int,

	amount double(18,2),

	unit varchar(10),

	idcategory int,

	idbrand int,

	idSupplier int,

	remarks varchar(100),

	partNum varchar(50),

	status varchar(50),

	transby varchar(50),

   PRIMARY KEY (`id`)

	)  ENGINE=InnoDB AUTO_INCREMENT=2378 DEFAULT CHARSET=utf8;



if paramcode = '' or paramcode='all' then

	

	


	select IFNULL(b.dateinput, '0000-00-00'), 0,0, 'BEG',a.code,IFNULL(b.begbalance, 0),

			0, 0, IFNULL(b.begbalance,0), a.cost, b.idunit,b.idCategory, b.idBrand,

			b.idSupplier, 'Beginning', null, b.partNum, 'system'

	from tblinventory a

	left join tblitem b on a.code = b.code

	order by b.dateinput;

	


	select  IFNULL(a.dateReceived, '0000-00-00'), a.idorder, a.roID, 'RCV', a.iditem, 0,IFNULL(a.qtyreceived, 0),0,0,a.cost,a.idUnit,

		 c.idCategory, c.idBrand, c.idSupplier, 'Receiving', null, c.partNum,b.receivedBy

	FROM tblordereditems a

	left join tblorder b on b.idorder = a.idOrder

	left join tblitem c on a.idItem = c.code

	order by a.dateReceived;

		


	SELECT IFNULL(b.dateSO, '0000-00-00'), a.id, (

			case

				when a.idMtrbikes <> 0 then b.salesInvc

				when b.jeid !='' and b.jeid!='0' then b.jeid

			else

				a.soID

			end)

			, (

			case

				when a.idMtrbikes <> 0 then 'INV'

				when b.jeid !='' and b.jeid!='0' then 'SVC'

			else

				'SO'

			end), a.iditem, 0,

			0, IFNULL(a.qty,0), 0, a.unitprice, c.idunit, c.idCategory, c.idBrand,

			c.idSupplier, 'Sales', null,c.partNum,b.preparedBy 

	from tblsales a

	left join tblsalesorder b on b.id = a.id and b.soID = a.soID

	left join tblitem c on c.code = a.idItem

 	order by b.dateSO;

	


	SELECT IFNULL(b.datePullOut, '0000-00-00'), a.idPullOut, a.pulloutid, 'POut', a.idItem, 

			0, 0, IFNULL(a.qty, 0), 0,a.unitPrice, c.idUnit, c.idCategory, c.idBrand,

			c.idSupplier, 'Pullout', null, c.partNum,b.preparedBy

	from tblpulloutitems a 

	left join tblpullout b on a.idPullOut = b.idPullOut

	left join tblitem c on a.idItem = c.code

	order by b.datePullout;

	

else


	select IFNULL(b.dateinput, '0000-00-00'), 0,0, 'BEG',a.code,IFNULL(b.begbalance,0),

			0, 0, IFNULL(b.begbalance,0), a.cost, b.idunit,b.idCategory, b.idBrand,

			b.idSupplier, 'Beginning', null, b.partNum, 'system'

	from tblinventory a

	left join tblitem b on a.code = b.code

	where a.code = paramcode

	order by b.dateinput;




	select IFNULL(a.dateReceived, '0000-00-00'), a.idorder, a.roID, 'RCV', a.iditem, 0,IFNULL(a.qtyreceived,0),0,0,a.cost,a.idUnit,

		 c.idCategory, c.idBrand, c.idSupplier, 'Receiving', null,c.partNum,b.receivedBy  

	FROM tblordereditems a

	left join tblorder b on b.idorder = a.idOrder

	left join tblitem c on a.idItem = c.code

	where a.status='received' and a.iditem=paramcode

	order by a.dateReceived;

	


	SELECT IFNULL(b.dateSO, '0000-00-00'), a.id, (

			case

				when a.idMtrbikes <> 0 then b.salesInvc

				when b.jeid !='' and b.jeid!='0' then b.jeid

			else

				a.soID

			end)

			, (

			case

				when a.idMtrbikes <> 0 then 'INV'

				when b.jeid !='' and b.jeid!='0' then 'SVC'

			else

				'SO'

			end), a.iditem, 0,

			0, IFNULL(a.qty,0), 0, a.unitprice, c.idunit, c.idCategory, c.idBrand,

			c.idSupplier, 'Sales', null,c.partNum, b.preparedBy   

	from tblsales a

	left join tblsalesorder b on b.id = a.id and b.soID = a.soID

	left join tblitem c on c.code = a.idItem

 	where a.iditem=paramcode

	order by b.dateSO;

	


	SELECT IFNULL(b.datePullOut, '0000-00-00'), a.idPullOut, a.pulloutid, 'POut', a.idItem, 

			0, 0, IFNULL(a.qty,0), 0,a.unitPrice, c.idunit, c.idCategory, c.idBrand, 

			c.idSupplier, 'Pullout', null,c.partNum, b.preparedBy  

	from tblpulloutitems a 

	left join tblpullout b on a.idPullOut = b.idPullOut

	left join tblitem c on a.idItem = c.code

	 	where a.iditem=paramcode

	order by b.datePullOut;



end if;



UPDATE TEMP z LEFT JOIN tblemployee a on concat(a.fName,' ',a.midInit,'.',' ',a.lName) = z.transby

left join tblempauth b on b.idEmp = a.idEmp

set z.transby = b.userName

where z.transby !='system';





DROP TABLE IF EXISTS TEMP2;

CREATE TEMPORARY TABLE TEMP2 (

	id int NOT NULL AUTO_INCREMENT,

	transdate Date,

	transid int,

	transNo varchar(20),

	transdesc varchar(20),

	code INT,

	qtybeg int,

	qtyin int,

	qtyout int,

	qtyend int,

	amount double(18,2),

	unit varchar(10),

	idcategory int,

	idbrand int,

	idSupplier int,

	remarks varchar(100),

	status varchar(50),

	partnum varchar(50),

	transby varchar(50),

   PRIMARY KEY (`id`)

	)  ENGINE=InnoDB AUTO_INCREMENT=2378 DEFAULT CHARSET=utf8;

	


SELECT transDate, transID, transNo,transDesc,code,qtyBeg,qtyIn,qtyOut,qtyEnd,amount,unit,idCategory,idBrand,idSupplier,remarks,status, partnum,transby 

FROM TEMP ORDER BY transdate;



UPDATE TEMP2 a set a.unit = (Select b.unit from tblunit b where a.unit = b.idUnit);



TRUNCATE TABLE TEMP;



BEGIN

DECLARE cur CURSOR FOR SELECT distinct CODE FROM TEMP2;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

set endingx = 0;

OPEN cur;

 SET done = 0;

   read_loop: LOOP

	    FETCH cur INTO codex;

	    IF done THEN

	    	LEAVE read_loop;

	    END IF;



		 	BEGIN

			DECLARE cur2 CURSOR FOR SELECT id FROM TEMP2 where code = codex order by id;

			DECLARE CONTINUE HANDLER FOR NOT FOUND SET done2 = 1;

			

			set minx = (select min(id) from TEMP2 WHERE code = codex);

			set endingx = (select qtyend from TEMP2 WHERE id = minx and code = codex );

			

			OPEN cur2;

			 SET done2 = 0;

			   read_loop2: LOOP

				    FETCH cur2 INTO idex;

				    IF done2 THEN

				    	LEAVE read_loop2;

				    END IF;

 				    		 	 UPDATE TEMP2 SET qtybeg = endingx

								 WHERE code = codex and id=idex;

								 

								 UPDATE TEMP2 SET qtyend = (qtybeg + qtyin - qtyout)

								 WHERE code = codex and id=idex;

								 set endingx = (select qtyend FROM TEMP2 WHERE id=idex and code = codex);

				END LOOP;

			CLOSE cur2;

			END;

       


	 SELECT transDate, transID, transNo,transDesc,code,qtyBeg,qtyIn,qtyOut,qtyEnd,amount,unit,idCategory,idBrand,idSupplier,remarks,status, partnum,transby

	 FROM TEMP2 WHERE code = codex;

	 

	END LOOP;

CLOSE cur;

END;

if paramcode = '' or paramcode = 'all' then

	TRUNCATE TABLE tblitemhistory;


	select transDate, transID, transNo,transDesc,code,qtyBeg,qtyIn,qtyOut,qtyEnd,amount,unit,idCategory,idBrand,idSupplier,remarks,status, partNum,ifnull(transby,'')

	from TEMP;

	

	SELECT 'tblitemhistory updated!' as Message;

else

	select

	id,

	DATE_FORMAT(transdate,'%Y-%m-%d') as transdate,

	transid,

	transNo,

	transdesc,

	code ,

	qtybeg,

	qtyin,

	qtyout,

	qtyend,

	amount,

	unit,

	idcategory,

	idbrand,

	idSupplier,

	remarks,

	status,

	partNum,

	ifnull(transby,'') as transby

	FROM TEMP2;

	

end if;



END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

