--
-- Definition of procedure `sp_invmasterlist`
--

DROP PROCEDURE IF EXISTS `sp_invmasterlist`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`dbb`@`192.168.1.94` PROCEDURE `sp_invmasterlist`(IN `date_start` daTE, IN `date_end` daTE)
BEGIN

DECLARE vMinid int;

DECLARE vMaxid int;

DECLARE vCode int;

DECLARE vSumIn double(18,2);

DECLARE vSumOut double(18,2);

DECLARE done INT;

DECLARE cntresult INT;

DROP TABLE IF EXISTS TEMP;

CREATE TEMPORARY TABLE TEMP (

	id int,

	transdate Date,

	transid int,

	transNo varchar(20),

	transdesc varchar(20),

	code INT,

	qtybeg int,

	qtyin int,

	qtyout int,

	qtyend int,

	amount double(18,2),

	unit varchar(10),

	idcategory int,

	idbrand int,

	idSupplier int,

	remarks varchar(100),

	idbeg int,

	idend int,

	status varchar(50)

  	);

  	



	BEGIN

	DECLARE cur CURSOR FOR select code from tblitemhistory

	where (qtybeg+qtyin+qtyout+qtyend) <> 0 group by code;

	



	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

	OPEN cur;

	 SET done = 0;

	   read_loop: LOOP

		    FETCH cur INTO vCode;

		    IF done THEN

		    	LEAVE read_loop;

		    END IF;

	

		set cntresult = (select count(idhistory) from tblitemhistory 

		where transdate >= date_start and transdate<=date_end and code = vCode);	

		

			if cntresult = 0 then

				set vMinid = (select max(idHistory) from tblitemhistory where transdate < date_start and code = vCode);

				set vMaxid = (select max(idHistory) from tblitemhistory where transdate < date_end and code = vCode);

				set vSumIn = (select qtyIn from tblitemhistory where idhistory = vMinid);

				set vSumOut = (select qtyOut from tblitemhistory where idhistory = vMinid);

				

			else		

				set vMinid = (select min(idhistory) from tblitemhistory where transdate >= date_start and transdate<=date_end and code = vCode group by code);

				set vMaxid = (select max(idhistory) from tblitemhistory where transdate >= date_start and transdate<=date_end and code = vCode group by code);

				set vSumIn = (select sum(qtyIn) from tblitemhistory where transdate >= date_start and transdate<=date_end and code = vCode group by code);

				set vSumOut = (select sum(qtyOut) from tblitemhistory where transdate >= date_start and transdate<=date_end and code = vCode group by code);

				

			end if;

		


		SELECT vMaxid, code,unit, idcategory, idbrand, idsupplier, vMinid, vSumIn, vSumOut, vMaxid from tblitemhistory

		WHERE  code = vCode and idhistory = vMaxid;

		

		

		

		UPDATE TEMP a left join tblitemhistory b on a.idend = b.idhistory

		SET a.transdate = b.transDate, a.transid = b.transID, a.transno = b.transNo, a.transdesc = b.transdesc, a.qtyend = b.qtyEnd, a.amount = b.amount

		WHERE a.code = vCode and b.idhistory = vMaxid;

				

		UPDATE TEMP a left join tblitemhistory b on a.idbeg = b.idhistory

		SET a.qtybeg = b.qtybeg

		WHERE a.code = vCode and b.idhistory = vMinid;

			

	END LOOP;

CLOSE cur;

END;

	select * from TEMP where id is not null and (qtybeg+qtyin+qtyout+qtyend) <> 0;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_JEreport`
--

DROP PROCEDURE IF EXISTS `sp_JEreport`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`dbb`@`192.168.1.94` PROCEDURE `sp_JEreport`(IN `paramsid` VARCHAR(50), IN `options` varCHAR(50))
BEGIN

DROP TEMPORARY TABLE IF EXISTS TEMP;

CREATE TEMPORARY TABLE TEMP

(

	id varchar(20),

	itemname varchar(50),

	code varchar(50),

	qty int,

	unit varchar(10),

	unitprice double(18,2),

	amount double (18,2),

	category varchar(50),

	sortkey int		

);

if options = "JE" then


	select a.jeid, c.itemName, concat(b.idItem, 

		(case 

		when c.partnum is null or c.partNum = 0 or c.partnum = "" then ""

		else concat(" / ",c.partNum)

		end)) as code,

		b.qty, b.unit, b.unitPrice, (b.qty * b.unitPrice), 'ITEMS', 1

		from tbljoborder a

	left join tbljoitems b on b.idJO = a.idJO

	left join tblitem c on c.code = b.idItem

	where jeid = paramsid;

	


	select a.jeid, b.services, '',

		if(b.minutes<=0,0,b.minutes),

		IF(b.minutes=0,'','min(s)'),

		if(b.minutes=0, 0,a.flatRate), 

		if(b.minutes>0,((b.minutes / 60) * a.flatRate),b.charge),

		'SERVICE LABOR & MATERIALS', 2 

		from tbljoborder a

	left join tbljoservices b on b.idJO = a.idJO

	where a.jeid = paramsid;



elseif options = "JO" then




	select a.joid, c.itemName, concat(b.idItem, 

		(case 

		when c.partnum is null or c.partNum = 0 or c.partnum = "" then ""

		else concat(" / ",c.partNum)

		end)) as code,

		b.qty, b.unit, b.unitPrice, (b.qty * b.unitPrice), 'ITEMS', 1

		from tbljoborder a

	left join tbljoitems b on b.idJO = a.idJO

	left join tblitem c on c.code = b.idItem

	where a.joid = paramsid;

	


	select a.joid, b.services, '',

		IF(b.minutes<=0,0,b.minutes),

		IF(b.minutes=0,'','min(s)'),

		IF(b.minutes=0, 0,a.flatRate), 

		IF(b.minutes>0,((b.minutes / 60) * a.flatRate),b.charge),

		'SERVICE LABOR & MATERIALS', 2 

		from tbljoborder a

	left join tbljoservices b on b.idJO = a.idJO

	where a.joid = paramsid;

end if;

DELETE FROM TEMP WHERE itemname is null and code is null;

select * from TEMP order by sortkey;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_sales`
--

DROP PROCEDURE IF EXISTS `sp_sales`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`dbb`@`192.168.1.94` PROCEDURE `sp_sales`(IN `date_start` VARCHAR(50), IN `date_end` VARCHAR(50), IN `options` VARCHAR(50))
BEGIN



DECLARE done INT;

DECLARE catid varchar(50);

DECLARE cmd varchar(1000);

DECLARE output_tax double(10,2);

DECLARE net_vat double(10,2);

DECLARE vatdiv float;

DECLARE taxdiv float;

DECLARE sum_qty int;



DROP TEMPORARY TABLE IF EXISTS TEMP;

CREATE TEMPORARY TABLE TEMP (

	dateSO Date,

	soID VARCHAR(15),

	itemname VARCHAR(100),

	qty int,

	unit VARCHAR(10),

	unitPrice double(10,2),

	discount int,

	amount double(18,2),

	netvat double(18,2),

	outputtax double(18,2),

	category varchar(50),

	remarks varchar(100),

	brand varchar(100),

	suppliercode varchar(10),

	supplier varchar(50),

	sortkey int

);

SET vatdiv = 1/1.12;

SET taxdiv = 12/100;



PREPARE stmt1 FROM 'INSERT INTO TEMP select b.dateSO, 

		(

		case 

			when a.soID="0" then 

			case 

				when b.salesInvc = "0" then b.salesOR

			else

				b.salesInvc

			end

		else

			a.soID

		end

		), c.Itemname, a.qty, e.Unit, a.unitPrice, a.discount, 

		(a.amount-(a.amount*(discount/100))),(amount * (1/1.12)) , 

		((amount * (1/1.12))* (12/100)), 

		d.Category, b.payMode, UPPER(f.brandname), g.code, UPPER(g.suppliername), 1 

from tblsales a

left join tblsalesorder b on b.id=a.id

left join tblitem c on c.code=a.idItem

left join tblitemcategory d on d.idCategory = c.idcategory

left join tblunit e on e.idUnit=c.idUnit

left join tblitembrand f on f.idbrand = c.idbrand

left join tblsupplier g on g.idsupplier = c.idsupplier

where b.dateSO between ? and ?

order by d.category, b.dateSO, a.soID';

set @start = date_start;

set @end = date_end;

EXECUTE stmt1 USING @start, @end;

DEALLOCATE PREPARE stmt1;



PREPARE stmt1 FROM 'INSERT INTO TEMP select b.dateRsrv, a.rsrvNo, a.itemname, a.qty, a.unit, b.downpayment, 0,b.downpayment, 

		(b.downpayment * (1/1.12)) , ((b.downpayment * (1/1.12))* (12/100)), 

		"Acknowledgement Receipt", b.remarks, "CASH COLLECTIONS","AR", "CASH COLLECTIONS", 5

from tblreserveitems a

left join tblreserveorder b on a.rsrvNo=b.rsrvNo 

left join tblitem c on c.iditem=a.iditem

left join tblitembrand d on d.idbrand=c.idbrand

left join tblsupplier e on e.idSupplier = c.idSupplier

where b.dateRsrv between ? and ?

order by b.dateRsrv, b.rsrvNo';

set @start = date_start;

set @end = date_end;

EXECUTE stmt1 USING @start, @end;

DEALLOCATE PREPARE stmt1;



PREPARE stmt1 FROM 'INSERT INTO TEMP select b.dateFinished, b.jeid, a.services,IF(a.minutes=0,1,a.minutes),
		IF(a.minutes=0, "Unit", "Min(s)"), IF(a.minutes=0, a.charge, b.flatRate),
		b.discount,	IF(a.minutes=0,a.charge,((a.minutes/60)*b.flatRate)), 
		IF(a.minutes=0,(a.charge*(1/1.12)),(((a.minutes/60)*b.flatRate) * 1/1.12)), 
		IF(a.minutes=0,(a.charge*(1/1.12)*12/100),((((a.minutes/60)*b.flatRate) * (1/1.12))* (12/100))),
		"Service Labor & Materials", "Service", "SERVICE LABOR", "SVC","SERVICE",4 

from tbljoservices a 

left join tbljoborder b on b.idjo = a.idJO

where dateFinished between ? and ? and status in("done","sold")

order by dateFinished, jeid';



set @start = date_start;

set @end = date_end;

EXECUTE stmt1 USING @start, @end;

DEALLOCATE PREPARE stmt1;



UPDATE TEMP SET SORTKEY = 3, brand='CONSIGNED ITEMS', supplier ='CONSIGNED ITEMS' WHERE CATEGORY LIKE '%consign%';

if options = 'summary' then

	DROP TEMPORARY TABLE IF EXISTS TEMPSUM;

	CREATE TEMPORARY TABLE TEMPSUM (

		category varchar(50),

		amount double(18,2),

		quantity int,

		cash double(18,2),

		charge double(18,2),

		advertising double(18,2),

		sortkey int

	);


		case 

			when category = "Service Labor & Materials" then count(qty)

		else

			sum(qty)

		end,

		0,0,0,sortkey

		from TEMP GROUP BY category, sortkey;

	UPDATE TEMPSUM a SET a.cash = (select sum(b.amount) from TEMP b where (b.remarks not like '%charge%' and b.remarks not like '%advertising%') and b.category = a.category);

	UPDATE TEMPSUM a SET a.charge = (select sum(b.amount) from TEMP b where b.remarks like '%charge%' and b.category = a.category);

	UPDATE TEMPSUM a SET a.advertising = (select sum(b.amount) from TEMP b where b.remarks like '%advertising%' and b.category = a.category);

		SELECT * FROM TEMPSUM ORDER BY category, SORTKEY;



elseif options = 'brand' then

	BEGIN

	UPDATE TEMP SET SORTKEY = 2 WHERE BRAND LIKE '%other%';

	DROP TEMPORARY TABLE IF EXISTS TEMPSUM;

		CREATE TEMPORARY TABLE TEMPSUM (

			brand varchar(50),

			amount double(18,2),

			quantity int,

			cash double(18,2),

			charge double(18,2),

			advertising double(18,2),

			sortkey int

		);

		


			case 

				when brand = "SERVICE LABOR" then count(qty)

			else

				sum(qty)

			end,

			0,0,0,sortkey

			from TEMP GROUP BY brand, sortkey;

			

		UPDATE TEMPSUM a SET a.cash = (select sum(b.amount) from TEMP b where (b.remarks not like '%charge%' and b.remarks not like '%advertising%') and b.brand = a.brand);

		UPDATE TEMPSUM a SET a.charge = (select sum(b.amount) from TEMP b where b.remarks like '%charge%' and b.brand = a.brand);

		UPDATE TEMPSUM a SET a.advertising = (select sum(b.amount) from TEMP b where b.remarks like '%advertising%' and b.brand = a.brand);

			SELECT * FROM TEMPSUM ORDER BY SORTKEY, BRAND;

	END;

elseif options = 'supplier' then

	BEGIN

	UPDATE TEMP SET SORTKEY = 2 WHERE supplier LIKE '%other%';

	DROP TEMPORARY TABLE IF EXISTS TEMPSUM;

		CREATE TEMPORARY TABLE TEMPSUM (

			supplier varchar(50),

			amount double(18,2),

			quantity int,

			cash double(18,2),

			charge double(18,2),

			advertising double(18,2),

			sortkey int

		);

		


			case 

				when brand = "SERVICE LABOR" then count(qty)

			else

				sum(qty)

			end,

			0,0,0,sortkey

			from TEMP GROUP BY sortkey,supplier;

			

		UPDATE TEMPSUM a SET a.cash = (select sum(b.amount) from TEMP b where (b.remarks not like '%charge%' and b.remarks not like '%advertising%') and b.supplier = a.supplier);

		UPDATE TEMPSUM a SET a.charge = (select sum(b.amount) from TEMP b where b.remarks like '%charge%' and b.supplier = a.supplier);

		UPDATE TEMPSUM a SET a.advertising = (select sum(b.amount) from TEMP b where b.remarks like '%advertising%' and b.supplier = a.supplier);

			SELECT * FROM TEMPSUM ORDER BY SORTKEY, supplier;

	END;

else

	if options = 'bySupplier'	then

		SELECT * FROM TEMP order by sortkey, supplier,dateSO, SOid;

	elseif options ='byBrand' then

		SELECT * FROM TEMP order by sortkey, brand, dateSO, SOid;

	elseif options ='byCategory' then

		SELECT * FROM TEMP order by sortkey, category, dateSO, SOid;

	else

		SELECT * FROM TEMP order by sortkey, dateSO, SOid;

	end if;

end if;



END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

